let images = [
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTV1F8AwmLQbvjs7GoSCKt-srwOv3vhGNAHGQ&usqp=CAU',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSxM1szNr_08Bc70yc7uo0lwI5XkyHVLq7ABQ&usqp=CAU',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQoUEzLKGWhf-Oc2y46H9-0xSXITsgTQklZNQ&usqp=CAU'
]


function fillStorage() {
    let array = []
    for (let i = 0; i < 50; i++) {
        let cert1 = new Certificate(
            "Gym",
            "Gym desc",
            "Expires in 4 day",
            "$21",
            images[Math.floor(Math.random() * images.length)],
            new Date()
        )
        let cert2 = new Certificate(
            "Gym2",
            "Gym2 desc",
            "Expires in 4 day",
            "$21",
            images[Math.floor(Math.random() * images.length)],
            new Date()
        )
        let cert3 = new Certificate(
            "Gym3",
            "Gym3 desc",
            "Expires in 2 day",
            "$21",
            images[Math.floor(Math.random() * images.length)],
            new Date()
        )
        let cert4 = new Certificate(
            "Gym4",
            "Gym4 desc",
            "Expires in 4 day",
            "$21",
            images[Math.floor(Math.random() * images.length)],
            new Date()
        )
        array.push(cert1, cert2, cert3, cert4)
     }
    localStorage.certificates = JSON.stringify(array)
}

if (localStorage.certificates === null) {
    fillStorage()
}